%ylabel('Number of contacts', 'FontSize', f_size, 'FontName', f_type)
%print(gcf,'-depsc2','contacts');
%print(gcf,'-dpng','contacts');


%figure(400);
%plot(contacts(contacts>0) ,solver, '.'); 
